var vue=new Vue({el:"#NoIndex",data:{title:"Học Viên Nợ",messageText:"",color:"",timeout:3e3,snackbar:!1,deleteDialog:!1,dialog:!1,selectedLopHoc:"",itemLopHoc:[],hocVienList:[],search:"",headers:[{text:"Học Viên",value:"hocVien",align:"left",sortable:!0},{text:"Lớp Học",value:"lopHoc",align:"left",sortable:!0},{text:"Ngày Nợ",value:"ngayNo",align:"left",sortable:!0},{text:"Tiền Nợ",value:"tienNo",align:"left",sortable:!0},{text:"Ngày Tạo",value:"createdDate",align:"left",sortable:!0},{text:"Người Tạo",value:"createdBy",align:"left",sortable:!0}]},async beforeCreate(){let e=this;await axios.get("/No/GetNoAsync").then(function(t){e.hocVienList=t.data}).catch(function(e){console.log(e.response.data.Message)})},methods:{formatNumber:e=>e.toLocaleString("it-IT",{style:"currency",currency:"VND"})}});